import { useContext } from 'react';
import './Expense.css';

const ExpenseItem = (props) => {

  return (

      <div>
        <div>{props.Description}</div>
        <div>{props.Year}</div>
        <div>{props.Amount}</div>
        <div>{props.Day}</div>
        <div>{props.Month}</div>
      </div>

  );
};

export default ExpenseItem;
